export default function ListarCard({resultado, setStatus, key}) {
    let icon = '';

    if (resultado === 'ruim') {
        icon = 'close-circle';
    } else if (resultado === 'ok') {
        icon = 'help-circle';
    } else if (resultado === 'bom') {
        icon = 'checkmark-circle';
    } else {
        icon = 'play-outline';
    }

    return (
        <li className={`card ${resultado}`} key={key} onClick={() => setStatus('aberta')}>
                    <h3>Flashcard {key}</h3>
                    <ion-icon name={icon}></ion-icon>
                </li>)
}
